function Counter(){
const[count,setcount]=useState(0);
return(
    <>
    {/* <h1>{count}</h1> */}
    <button onClick={()=>{
        setcount(count+1);
    }}
    >increase: ' '{count}</button>
    <button onClick={()=>{
        setcount(count-1);
    }}
    >decrease</button>
    </>
)
}
export default Counter;
